div.p:
// Returns the paths of all files within the inputDir (recursive traversal)
// Will remove the ignored paths before returning the list (.temingoignore)
RetrieveFilePaths(inputDir) ([]string, err)

// Writes the provided file to the specified path within the outputDir
// Will create the required folders
WriteFile(path string, content string) (err)

// Copies the specified file into the outputDir
// Will create the required folders
CopyFile(path string) (err)

// Reads the necessary files from the inputDir
// Renders all templates and metatemplates
// Writes the rendered files to the outputDir
// Copies the static files from the inputDir to the outputDir
Render() (err)
